import React, { useState } from "react";
import "./style.css";
import Repost from "./chat.png";
import wse from "./heart.png";
import chtoto from "./exchange.png";
import tweet from "./twitter.png";
import { LikeIcon } from "./LikeIcon";

export const Tweet = ({
  name,
  text,
  retweet,
  comments,
  likes,
  time,
  isLiked,
}) => {
  const [liked, setLiked] = useState(isLiked);
  return (
    <div className="box">
      <div className="inner">
        <div className="avatar"></div>
        <div className="text-box">
          <div className="name-box">
            <div className="name">
              {name}
              <img className="tweet" src={tweet} />
            </div>
            <div className="time">{time}</div>
          </div>
          <div className="text">{text}</div>
          <div className="like-box">
            <div className="reposts">
              <img className="retweet" src={chtoto} />
              {retweet}
            </div>
            <div className="comment-box">
              <div className="comments">
                <img className="chat" src={Repost} />
                {comments}
              </div>
              <div className="like">
                <LikeIcon className="heart" />
                {likes}
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};
